var userid;
function loadGame() {
    userid = (userid == null) ? document.getElementById("userid").value : userid;
    classicSnakeGame();
    setTimeout(toggleIntro, 70);

}

function classicSnakeGame() {

    var lives = 3;
    var canvas = document.getElementById('myCanvas');
    var ctx = canvas.getContext('2d');

    var size = 0;
    var creatureObj = [{}];
        buildSnake();
    var head;
    var tail;


    var bgImage = new Image();
    bgImage.src = "data:image/jpeg;base64,";
    var pat = ctx.createPattern(bgImage, "repeat");

    var ajaxResponse;
    var score = 0;
    var creature_box_lgth = canvas.width * (5/100);

    var direction = "Right";

    var apple = {
        x : Math.floor(Math.random() * (canvas.width / creature_box_lgth)) * creature_box_lgth,
        y : Math.floor(Math.random() * (canvas.width / creature_box_lgth)) * creature_box_lgth,
    }

    var counter = 130;
    function increaseInterval() {
        clearInterval(interval);
        if (size > 40) {
            counter -= 10;
        } else {
            counter = (counter <= 100) ? counter : (counter - 5);
        }
        console.log(counter);
        interval = setInterval(function(){ playGame();}, counter);
    }

    var interval = setInterval(function(){ playGame();}, counter);
    function playGame() {
        //while (size < 5) { add();} /*If not using Build Snake Performance Brute Force Technique, uncomment this line.
        uponFoodCollision();
        move();
        uponDeadlyCollision();
        draw();

    }



    function draw() {

        drawBG();
        drawApple();
        drawSnake();

        function drawBG() {


            ctx.rect(0, 0, canvas.width, canvas.height);
            ctx.fillStyle = pat;
            ctx.fill();
        }

        function drawApple() {
            ctx.lineWidth = ".4";
            ctx.fillStyle = "red";
            ctx.fillRect(apple.x, apple.y, creature_box_lgth, creature_box_lgth);

        }

        function drawSnake() {
            ctx.fillStyle = "orange";
            ctx.strokeStyle = "black";

            current = tail;
            while (current != null) {
                ctx.fillRect(current.x, current.y, creature_box_lgth, creature_box_lgth);
                ctx.strokeRect(current.x, current.y, creature_box_lgth, creature_box_lgth);
                current = current.next;
            }
        }

    }



    function add() {

        if (size == 0) {
            creatureObj[0] = {
                x : 0,
                y : 100,
                index : 0,
                next : creatureObj[-1]
            }
            head = creatureObj[0];
            tail = creatureObj[0];

        } else {
            var oldtIndex = tail.index;

            creatureObj[size] = {
                x : tail.x,
                y : tail.y,
                index : size,
                next : tail,
            }

            fixT(creatureObj[size], tail);
            tail = creatureObj[size];
            tail.next = creatureObj[oldtIndex];

        }

        size++;

        function fixT(obj, tail) {

            var bearing;
            var arrows = ["Right", "Left", "Up", "Down"];
            if (tail.next == null) {
                bearing = direction;
            } else {

                if (tail.x == tail.next.x) {
                    bearing = (tail.y < tail.next.y ) ? "Down" : "Up";
                } else if (tail.y == tail.next.y) {
                    bearing = (tail.x < tail.next.x ) ? "Right" : "Left";
                }

                var newbearing = bearing;
                while (onEdge(tail, newbearing)) {
                    if (newbearing == bearing) {
                        newbearing = getComplement(newbearing);
                    } else {
                        newbearing = getOpposite(newbearing);
                    }
                }

                bearing = newbearing;
            }

            switch(bearing) {
                case "Down":
                    obj.y += -creature_box_lgth;
                    break;

                case "Up":
                    obj.y += creature_box_lgth;
                    break;

                case "Left":
                    obj.x += creature_box_lgth;
                    break;

                case "Right":
                    obj.x += -creature_box_lgth;
                    break;

                default:
                    return;

            }

            function onEdge(obj, bearing) {

                switch (bearing) {
                    case "Right":
                        return (obj.x == 0);
                        break;
                    case "Left":
                        return (obj.x + creature_box_lgth == canvas.width);
                        break;
                    case "Up":
                        return (obj.y + creature_box_lgth == canvas.height);
                    case "Down":
                        return (obj.y == 0);
                        break;
                    default:
                        break;
                }

            }

            function getComplement(bearing) {
                switch(bearing) {
                    case "Right":
                    case "Left":
                        return "Up";
                        break;
                    case "Down":
                    case "Up":
                        return "Right";
                        break;
                    default:
                        break;
                }
            }

            function getOpposite(bearing) {
                switch (bearing) {
                    case "Right":
                        return "Left";
                        break;
                    case "Left":
                        return "Right";
                        break;
                    case "Up":
                        return "Down";
                        break;
                    case "Down":
                        return "Up";
                        break;
                }
            }

        }

    }



    function move() {

        if (size == 0) {
            return;
        }

        if (size == 1) {
            fix(creatureObj[tail.index]);
            return;
        }

        var hIndex = head.index;
        var tIndex = tail.index;
        var newTail = creatureObj[tIndex].next;

        creatureObj[tIndex].x = creatureObj[hIndex].x;
        creatureObj[tIndex].y = creatureObj[hIndex].y;
        creatureObj[hIndex].next = creatureObj[tIndex];
        creatureObj[tIndex].next = null;

        tail = newTail;
        head = creatureObj[tIndex];

        fix(creatureObj[tIndex]);

        function fix(obj) {

            switch(direction) {
                case "Down":
                    obj.y += creature_box_lgth;
                    break;

                case "Up":
                    obj.y += -creature_box_lgth;
                    break;

                case "Left":
                    obj.x += -creature_box_lgth;
                    break;

                case "Right":
                    obj.x += creature_box_lgth;
                    break;

                default:
                    return;

            }

        }

    }

    /*Build Snake Brute Force Performance Improvement Technique: Build basic snake body To Improve Performance */
    function buildSnake() {
        creatureObj[0] = {
            index: 0,
            next: undefined,
            x: 0,
            y: 100

        };
        creatureObj[1] = {
            index: 1,
            next: creatureObj[0],
            x: -20,
            y: 100

        };
        creatureObj[2] = {
            index: 2,
            next: creatureObj[1],
            x: -40,
            y: 100

        };
        creatureObj[3] =    {
            index: 3,
            next: creatureObj[2],
            x: -60,
            y: 100

        };
        creatureObj[4] =     {
            index: 4,
            next: creatureObj[3],
            x: -80,
            y: 100
        };
        head = creatureObj[0];
        tail = creatureObj[4];
        size = 5; //update size
    }

    /* End of building Basic Snake Body To Improve Performance */


    window.addEventListener("keydown", function(event) {

        switch(event.keyIdentifier) {
            case "Down":
            case "Up":
            case "Right":
            case "Left":
                direction = (isParallel(direction, event.keyIdentifier)) ? direction : event.keyIdentifier;
                break;
            default:
                break;
        }

        function isParallel(oldBearing, newBearing) {

            if (oldBearing == "Right" || oldBearing == "Left") {

                switch(newBearing) {
                    case "Left":
                    case "Right":
                        return true;
                        break;
                    default:
                        return false;
                        break;
                }

            } else {

                switch(newBearing) {
                    case "Up":
                    case "Down":
                        return true;
                        break;
                    default:
                        return false;
                        break;
                }

            }
        }

    });



    function playAudio(action) {
        /* Actions include strings: "food", "bite", and "hit" */

        var appleCrunch = new Audio(["audio/apple_crunch.wav"]);
        appleCrunch.volume = .5;
        appleCrunch.preload = "auto";

        var lifeLostGameOver = new Audio(["audio/life-lost-game-over.wav"]);
        lifeLostGameOver.volume = .3;

        var ateItself = new Audio(["audio/ate_iteself.mp3"]);

        switch(action){
            case "food":
                appleCrunch.play();
                break;
            case "bite":
                ateItself.play();
                break;
            case "hit":
                lifeLostGameOver.play();
                break;
        }

    }


    function uponFoodCollision() {

        if (!testFoodCollision()) { return; } else { foodCollisionHelper(); }

        function testFoodCollision() {
            if (head.x == apple.x && head.y == apple.y) {
                return true;
            }
            return false;
        }

        function foodCollisionHelper() {
            score = score + 100;
            playAudio("food");
            updateScore();
            resetApple();
            add();
            increaseInterval();


            function resetApple() {
                apple.x = Math.floor(Math.random() * (canvas.width / creature_box_lgth)) * creature_box_lgth;
                apple.y = Math.floor(Math.random() * (canvas.width / creature_box_lgth)) * creature_box_lgth;
            }

        }



    }

    function uponDeadlyCollision() {

        if (testWallCollision() ) { playAudio("hit"); }
        else if (testBodyCollision() ) {
            playAudio("bite");
        } else { return; }

        lives = lives - 1;
        if (lives <= 0) { setValues(); ajaxRequest(); resetIntro(); clearInterval(interval); }
        else { setValues(); }


        function setValues() {
            size = 0;
            creatureObj = [{}];
                buildSnake();
            direction = "Right"; counter = 135;
            apple.x = Math.floor(Math.random() * (canvas.width / creature_box_lgth)) * creature_box_lgth;
            apple.y = Math.floor(Math.random() * (canvas.width / creature_box_lgth)) * creature_box_lgth;
            updateScore();
            increaseInterval();
        }

        function resetIntro() {
            apple.x = -20;
            apple.y = -20;
            draw();
            showNext();
            toggleIntro();
        }


    }


    function testWallCollision() {

        if (head == null) return false;

        if (head.x >= canvas.width || head.x < 0 || head.y >= canvas.height || head.y < 0) {
            return true;
        } else {
            return false;
        }

    }

    function testBodyCollision() {

        current = tail;

        while (current != head){
            if (head.x == current.x && head.y == current.y) {
                return true;
            }
            current = current.next;
        }


        return false;

    }


    function updateScore() {

        var myscore = document.getElementById("score");
        myscore.innerHTML = "Score: " + score + "| Lives: " + lives;
    }

    function ajaxRequest() {

        var jsondata = {
            userid: userid,
            score: score
        };

        return postRequest(
            'functions.php',
            JSON.stringify(jsondata)
        );
    }

    function drawSuccess() {

        var currentScore = "<p>You Lost! <br>Nickname: " + userid + "<br>Your Score: " + score;
        var button = "<br><button>Replay</button>";
        var data = currentScore + "<br>" + ajaxResponse + "<br><br>";

        var page3 = document.getElementById("intropage3");

        var btn = document.createElement("BUTTON");
        btn.addEventListener("click", loadGame);
        btn.innerHTML = "Replay";

        page3.innerHTML = data;
        page3.appendChild(btn);

    }

    function postRequest(url, data){
        var req = false;

        try {
            req = new XMLHttpRequest();
        } catch(e) {
            // IE
            try {
                req = new ActiveXObject("Msxml2.XMLHTTP");
            } catch(e){
                //try an older browser
                try {
                    req = new ActiveXObject("Microsoft.XMLHTTP");
                } catch(e){
                    return false;
                }
            }
        }

        if (!req) return false;

        req.open("POST", url, true);
        req.onreadystatechange = function () {
            if (req.readyState==4 && req.status==200)
            {
                ajaxResponse = this.responseText;
                drawSuccess();
            }

        }

        req.setRequestHeader("Content-Type", "application/json");
        req.send(data);

        return ajaxResponse;
    }
}

function showNext() {

    var page1, page2, page3;
    page1 = document.getElementById("intropage1");
    page2 = document.getElementById("intropage2");
    page3 = document.getElementById("intropage3");

    if (page1.style.display != "none"){
        page1.style.display = "none";
        page2.style.display = "inherit";
    } else if (page2.style.display != "none"){
        page2.style.display = "none";
        page3.style.display = "inherit";
    }


}

function toggleIntro() {
    var intro = document.getElementById('intro');

    if (intro.style.display != "none") {
        intro.style.display = "none";
    } else {
        intro.style.display = "inherit";
    }

}


